        slidesPerView={2}
        loop
        onSlideChange={() => console.log('slide change')}
        onSwiper={(swiper) => console.log(swiper)}
      >
      {
        Expcarddata.map((val,ind)=>{
          return <Expcard date={val.date} title={val.title} para={val.para}/>
        })}
      </Swiper>

    </>);
}

export default Experience;
